import { Form, FormGroup, Input, Navbar, NavbarBrand, NavItem } from 'reactstrap';
import React from 'react';

class NavBar extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
        <Navbar color="light" classname="ms-auto">
            <NavbarBrand href="/">Image Search</NavbarBrand>
            <NavItem>
                <Form classname="ms-auto">
                    <FormGroup>
                        <Input type="text" placeholder="Search Images ..."></Input>
                    </FormGroup>
                </Form>
            </NavItem>
        </Navbar>
        );
    }
}

export default NavBar
